import React from 'react';
import { useMediaQuery } from 'react-responsive';
import heroImage from "../../assets/images/akshay.png";

const UserInterface = () => {
  // Define media queries
  const isMobileDevice = useMediaQuery({ query: "(min-device-width: 480px)" });
  const isTabletOrAbove = useMediaQuery({ query: "(min-device-width: 768px)" });
  const isLaptopOrAbove = useMediaQuery({ query: "(min-device-width: 1024px)" });

  const styles = {
    section: {
      backgroundColor: '#f9f9f9',
      color: '#333',
      padding: '4rem 0',
    },
    container: {
      maxWidth: '1200px',
      margin: '0 auto',
      padding: '0 1.5rem',
    },
    contentWrapper: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      gap: '2rem',
      textAlign: 'center',
    },
    textSection: {
      flex: 1,
    },
    greeting: {
      color: '#888',
      fontWeight: 500,
      fontSize: '1.25rem',
      marginBottom: '0.5rem',
    },
    mainHeading: {
      color: '#222',
      fontWeight: 800,
      fontSize: '2.5rem',
      lineHeight: '1.2',
      marginBottom: '1rem',
    },
    subHeading: {
      color: '#4a90e2',
      fontSize: '2rem',
    },
    buttonGroup: {
      display: 'flex',
      flexDirection: 'column',
      gap: '1rem',
      alignItems: 'center',
      marginBottom: '2rem',
    },
    hireButton: {
      backgroundColor: '#4a90e2',
      color: 'white',
      fontWeight: 500,
      padding: '0.75rem 1.5rem',
      borderRadius: '8px',
      border: 'none',
      cursor: 'pointer',
      transition: 'background-color 0.3s ease, transform 0.3s ease',
    },
    hireButtonHover: {
      backgroundColor: '#357abd',
      transform: 'scale(1.05)',
    },
    portfolioLink: {
      color: '#4a90e2',
      fontWeight: 600,
      borderBottom: '2px solid #4a90e2',
      paddingBottom: '0.25rem',
      transition: 'color 0.3s ease',
    },
    portfolioLinkHover: {
      color: '#357abd',
    },
    description: {
      color: '#666',
      fontSize: '1rem',
      lineHeight: '1.6',
      marginTop: '1.5rem',
      textAlign: 'center',
      maxWidth: '600px',
      marginLeft: 'auto',
      marginRight: 'auto',
    },
    icon: {
      fontSize: '1.5rem',
      marginRight: '0.5rem',
    },
    contactInfo: {
      marginTop: '2rem',
      fontSize: '1rem',
      color: '#666',
      textAlign: 'center',
    },
    contactLabel: {
      color: '#4a90e2',
      fontWeight: 600,
    },
    contactLink: {
      display: 'block',
      color: '#4a90e2',
      fontWeight: 600,
      marginTop: '0.5rem',
      textDecoration: 'none',
      transition: 'color 0.3s ease',
    },
    contactLinkHover: {
      color: '#357abd',
    },
    imageSection: {
      flex: 1,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    },
    heroImage: {
      width: '80%',
      maxWidth: '400px',
      borderRadius: '12px',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
      border: '4px solid #4a90e2',
    },
  };

  return (
    <section style={styles.section} id="about">
      <div style={styles.container}>
        <div style={styles.contentWrapper}>
          <div style={styles.textSection}>
            <h5 style={styles.greeting}>
              Hello, Welcome
            </h5>
            <h1 style={styles.mainHeading}>
              I am Akshay Balte <br />
              <span style={styles.subHeading}>Software Developer</span>
            </h1>
            <div style={styles.buttonGroup}>
              <a href="#contact">
                <button 
                  style={styles.hireButton} 
                  onMouseEnter={(e) => e.currentTarget.style.backgroundColor = styles.hireButtonHover.backgroundColor}
                  onMouseLeave={(e) => e.currentTarget.style.backgroundColor = styles.hireButton.backgroundColor}
                >
                  <i className="ri-mail-fill"></i> Hire me
                </button>
              </a>
              <a 
                href="#portfolio" 
                style={styles.portfolioLink} 
                onMouseEnter={(e) => e.currentTarget.style.color = styles.portfolioLinkHover.color}
                onMouseLeave={(e) => e.currentTarget.style.color = styles.portfolioLink.color}
              >
                See Portfolio
              </a>
            </div>
            <p style={styles.description}>
              <span style={styles.icon}><i className="ri-command-fill"></i></span>
              I build and code full-stack applications with a focus on simplicity and user experience. As a passionate Full Stack Developer, 
              I have strong skills in both front-end and back-end technologies. Known for my hard work and clear communication, I’m dedicated to creating effective and user-friendly software. 
              I thrive in collaborative environments and am eager to use my skills to take on new challenges and drive innovation. 
              Let’s connect and explore how we can work together!
            </p>
            <div style={styles.contactInfo}>
              <span style={styles.contactLabel}>Contact:</span>
              <div>
                <a href="#Email" style={styles.contactLink}>
                  <i className="ri-mail-line"></i> balteakshay1998@gmail.com
                </a>
              </div>
              <div>
                <a href="https://www.linkedin.com/in/akshay-balte-developer/" style={styles.contactLink}>
                  <i className="ri-linkedin-box-fill"></i> https://www.linkedin.com/in/akshay-balte-developer/
                </a>
              </div>
              <div>
                <a href="#Phone" style={styles.contactLink}>
                  <i className="ri-phone-line"></i> 7447686701
                </a>
              </div>
            </div>
          </div>
          <div style={styles.imageSection}>
            <img src={heroImage} alt="Portrait of Akshay Balte" style={styles.heroImage} />
          </div>
        </div>
      </div>
    </section>
  );
};

export default UserInterface;
